  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Clarence
  Rhode National Wildlife Range outlines Refuge accomplishments during the 1965 calendar
  year. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover conditions during the year. Wildlife- including
  migratory birds, furbearers, rodents, and mammals- is also covered. A progress report
  on field investigations and applied research is also provided. The public relations
  section of the report describes recreational uses and Refuge visitors. N-R forms
  and photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
